		public static void protect(string path, string output, bool junk)
		{
			ModuleDefMD moduleDefMD = ModuleDefMD.Load(path);
			if (junk)
			{
				Junk.Run(moduleDefMD);
			}
			fakeobfuscator.Execute(moduleDefMD);
			Junk.JunkString(moduleDefMD);
			StringEnc2.Run(moduleDefMD);
			StringEnc.Run(moduleDefMD);
			ControlFlow.Execute(moduleDefMD);
			Rename.Run(moduleDefMD);
			hideMethods.Execute(moduleDefMD);
			moduleDefMD.Write(output, new ModuleWriterOptions(moduleDefMD)
			{
				PEHeadersOptions = 
				{
					NumberOfRvaAndSizes = 13u
				},
				Logger = DummyLogger.NoThrowInstance
			});
			moduleDefMD.Dispose();
		}

