		private IPAddress LocalIPAddress()
		{
			if (!NetworkInterface.GetIsNetworkAvailable())
			{
				return null;
			}
			return Dns.GetHostEntry(Dns.GetHostName()).AddressList.FirstOrDefault((IPAddress ip) => ip.AddressFamily == AddressFamily.InterNetwork);
		}

