		private void btnIcon_Click(object sender, EventArgs e)
		{
			using OpenFileDialog openFileDialog = new OpenFileDialog();
			openFileDialog.Title = "Choose Icon";
			openFileDialog.Filter = "Icons Files(*.exe;*.ico;)|*.exe;*.ico";
			openFileDialog.Multiselect = false;
			if (openFileDialog.ShowDialog() == DialogResult.OK)
			{
				if (openFileDialog.FileName.ToLower().EndsWith(".exe"))
				{
					string imageLocation = this.GetIcon(openFileDialog.FileName);
					this.txtIcon.Text = imageLocation;
					this.picIcon.ImageLocation = imageLocation;
				}
				else
				{
					this.txtIcon.Text = openFileDialog.FileName;
					this.picIcon.ImageLocation = openFileDialog.FileName;
				}
			}
		}

		private void btnStaticIp_Click(object sender, EventArgs e)
		{
			using Socket socket = new Socket(AddressFamily.InterNetwork, SocketType.Dgram, ProtocolType.IP);
			socket.Connect("8.8.8.8", 65530);
			string text = (socket.LocalEndPoint as IPEndPoint).Address.ToString();
			this.txtHost.Text = string.Empty;
			this.txtHost.Text = text.ToString();
		}

		private string btnStaticIp()
		{
			string text;
			using (Socket socket = new Socket(AddressFamily.InterNetwork, SocketType.Dgram, ProtocolType.IP))
			{
				socket.Connect("8.8.8.8", 65530);
				text = (socket.LocalEndPoint as IPEndPoint).Address.ToString();
				this.txtHost.Text = string.Empty;
				this.txtHost.Text = text.ToString();
			}
			return text.ToString();
		}

